package Loops.doWhile;

public class DoWhile_Ex1 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int i=1, n=5;
		
		do {
			System.out.println(n+" x "+i+" = "+n*i);
			i++;
		}while(i<=10);
		
		
		int j=1;
		do {
			System.out.print(j*j*j + " ");
			j++;
		}while(j<=10);
	}
	

}
